import Video from './demo_vids/empty_counter.mp4';
import Poster from './demo_vids/empty_counter.jpg';
import Img from './images/empty_counter.png';
export const empty = {
    lightBg: false,
    lightText: true,
    lightTextDesc: true,
    headline: 'Empty Counter Detection',
    description:
      'For Hospitals, Offices etc reception counters should never be empty as people can arrive at anytime and need to be attended to. Hence, our model will check if and when the counter/reception is empty and will generate a message/alert accordingly.',
    imgStart: '',
    img: Img,
    alt: 'Credit Card',
    path: Video,
    poster: Poster
  };
